import React from "react";
import './index.css'

const Friend = () => {
  return (
    <>
      <div className="container col my-5">
        <div className="container mx-2 mt-5">
          <h2 className="text-center text-success">Hey ! My Dear Friend</h2>
          <p className="text-secondary text-center" style={{fontSize:" 20px"}}>
            I just want to say thanks you for being a part of our journey ,
            Helping out me for Everytime
          </p>
        </div>
      </div>

      <img src="friends-4187953_1280.webp" className="img" />
      <h1 className="text-center text-primary my-5">Thank You Buddy</h1>
      <div className="bubble">
        <svg className="heart" viewBox="0 0 600 500">
          <path d="M300,150 C500,10 600,300 300,400 C0,300 100,10 300,150" />
        </svg>
        <div className="bubble-dummy"></div>
      </div>
    </>
  );
};

export default Friend;
